import React, { Component } from 'react'
import "./styles.css"



class App extends Component {
  constructor(props) {
    super(props)
    this.state = {
      counter : 5,
      show : false
    }
  }

  changeCounter = () => {
    this.setState({ counter : 12 })
  }
  render() {
    return (
      <div>
        <h3>this counter is : {this.state.counter}</h3>
        <button onClick={this.changeCounter}>Click</button>
        <h4></h4>
      </div>
    )
  }
}


export default App;
